import { Stack, Typography } from "@mui/material";

const Sidebar = () => {
  const pages = [
    { number: 1, name: "KY Sheet Details" },
    { number: 2, name: "Hints" },
    { number: 3, name: "RISK AREAS" },
  ];
  return (
    <Stack spacing={3}>
      {pages.map((page) => (
        <Stack key={page.number} direction="row">
          <Typography
            sx={{
              width: 20,
              height: 20,
              backgroundColor: "#000080",
              borderRadius: "50%",
              color: "#fff",
            }}
          >
            {page.number}
          </Typography>
          <Typography>{page.name}</Typography>
        </Stack>
      ))}
    </Stack>
  );
};
export default Sidebar;
